import React from 'react';
import { Link } from 'react-router-dom';

const Navbar = ({ isHomePage }) => {
  return (
    <nav className={`shadow-md ${isHomePage ? 'absolute top-0 left-0 w-full z-10 bg-transparent text-white' : 'bg-white text-black shadow-lg'}`}>
      <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8">
        <div className="flex justify-between items-center h-16">
          <div className="flex-shrink-0">
            <h1 className="text-xl font-bold">Instalaciones XYZ</h1>
          </div>
          <div className="hidden md:flex space-x-8">
            <Link to="/home" className={`${isHomePage ? 'text-white hover:text-gray-300' : 'text-gray-700 hover:text-gray-900'} font-bold`}>
              Home
            </Link>
            <Link to="/servicios" className={`${isHomePage ? 'text-white hover:text-gray-300' : 'text-gray-700 hover:text-gray-900'} font-bold`}>
              Servicios
            </Link>
            <Link to="/contacto" className={`${isHomePage ? 'text-white hover:text-gray-300' : 'text-gray-700 hover:text-gray-900'} font-bold`}>
              Contacto
            </Link>
            <Link to="/nosotros" className={`${isHomePage ? 'text-white hover:text-gray-300' : 'text-gray-700 hover:text-gray-900'} font-bold`}>
              Nosotros
            </Link>
          </div>
        </div>
      </div>
    </nav>
  );
};

export default Navbar;
